import React, {Component} from 'react';
import './App.css';
import Header from "../header/Header";
import Sections from "../sections/Sections";
import Carousel from "../sections/carousel/Carousel"

class App extends Component {
  render() {
      return (
        <div className="App">
          <Header/>
          <Sections> 
            <Carousel/>
          </Sections>
        </div>
      );
  }
}
export default App;
